import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router} from 'react-router-dom';
import {Provider} from 'react-redux';
import App from './modules/Apps';

ReactDOM.render(
	<Router>
		<Provider>
			<App />
		</Provider>
	</Router>,
	document.getElementById('root'),
);
